            <g transform="translate(-25 0)">
                <text transform="translate(1031.33 454.77)"
                      style="font-size:36px;fill:#67c3c4;font-family:MicrosoftYaHei-Bold, Microsoft YaHei;font-weight:700">
                    最后一公里
                    <tspan style="font-size:18px;fill:#fff;font-family:MicrosoftYaHei, Microsoft YaHei;font-weight:400">
                        <tspan x="0" y="56">1月23日，随着封城的实施，武汉市内原本的物流运输渠道也随之失去了原本的秩序。</tspan>
                        <tspan x="0" y="112">1月24日，注定是个不平凡的除夕之夜,江城失去了往昔的熙熙攘攘，医院的储备已供不应求，</tspan>
                        <tspan x="0" y="140">超市也早就被洗劫一空。</tspan>
                        <tspan x="0" y="196">1月25日，国家召开紧急会议，启动支援应急物流的一系列举措。供应端补给充足、绿色通道</tspan>
                        <tspan x="0" y="224">开启、干线运输畅通、应急物资源源不断地涌向江城。</tspan>
                        <tspan x="0" y="280">但是，市民的补给被卡在了最后一公里……</tspan>
                        <tspan x="0" y="336">近2/3的快递驿站关停，大量的终端派送员离开岗位，江城的物流面临着前所未有的挑战。</tspan>
                    </tspan>
                </text>
                <text id="carText" opacity="0" transform="translate(1031.33 454.77)"

ext></g><text transform="translate(671.57 628.76)" style="font-size:24px;fill:#fff;font-family:MicrosoftYaHei-Bold, Microsoft YaHei;font-weight:700">| 作品描述<tspan style="font-size:16px;font-family:MicrosoftYaHei, Microsoft YaHei;font-weight:400"><tspan x="0" y="45">江城武汉素有“九省通衢”之称，该作品以疫情期间武汉封城事件为背景，构建了一个关于应急物流打通武汉城</tspan><tspan x="0" y="69">市命脉的可视化互动叙事网页。网页通过艺术手法，以武汉樱花为线索，贯穿描绘“疫·断”、“祈·愿”、“落·</tspan><tspan x="0" y="93">定”、“众·志”、“桥·连”五大篇章。其中，第一篇章“疫·断”展示了武汉封城期间，全国各省份对其物资支</tspan><tspan x="0" y="117">援情况；第二篇章“祈·愿”展示了国民对武汉的暖心祝福；第三篇章“落·定”呈现了在火神山医院筹备建造过</tspan><tspan x="0" y="141">程中，中国各大行业企业及时响应，按需时序性供应各类物资支援建设；第四篇章“众·志”展示了在末端配送过</tspan><tspan x="0" y="165">程中，武汉来自各行各业的市民自发承担最后一公里的运输任务，完成了特殊时期整个物流行业闭环的连接；第</tspan><tspan x="0" y="189">五篇章“桥·连”展开呈现应急物流作为特殊时期的桥梁，如何连接着祖国的每一座城市。《瞿行》旨在传播武汉</tspan><tspan x="0" y="213">封城不孤城背后的数据故事，以及祖国紧密的连接的民族凝聚力。</tspan><tspan x="0" y="261">望，伟大的祖国山河无恙……</tspan></tspan></text><text transform="translate(273.57 628.76)" style="font-size:24px;fill:#fff;font-family:MicrosoftYaHei-Bold, Microsoft YaHei;font-weight:700">| 创作团队<tspan style="font-size:16px;font-family:MicrosoftYaHei, Microsoft YaHei;font-weight:400"><tspan x="0" y="45" xml:space="preserve">刘   芳，指导教师，湖南大学，设计艺术学院</tspan><tspan x="0" y="69">梁丰洲，技术总监，中山大学，计算机学院</tspan><tspan x="0" y="93">汪琳琪，创意总监，湖南大学，设计艺术学院</tspan><tspan x="0" y="117" xml:space="preserve">宁   斌，数据清洗，湖南大学，设计艺术学院</tspan></tspan></text><text transform="translate(1537.66 628.76)" style="font-size:24px;fill:#fff;font-family:MicrosoftYaHei-Bold, Microsoft YaHei;font-weight:700">| 数据来源<tspan style="font-size:16px;font-family:MicrosoftYaHeiLight, Microsoft YaHei;font-weight:400"><tspan x="0" y="45">微博、中华人民共和国交通运输部、中国物流</tspan><tspan x="0" y="69">与采购网、E起支援疫情物资供需平台、珞樱</tspan><tspan x="0" y="93">善联、海尔</tspan><tspan x="80" y="93" style="letter-spacing:-0.021484375em">C</tspan><tspan x="90.39" y="93">OSMOplat物资供应平台、中国</tspan><tspan x="0" y="117">志愿服务网、GitHub相关物资数据。</tspan></tspan></text><path d="M159,670.35c-.19.68-.41,1.3-.63,1.91h9. "288">桥是武汉与世界的连系；</tspan><tspan x="42" y="324">桥是团结与合作的成果；</tspan><tspan x="10.5" y="360">桥是传递人民诚挚祈愿的驿站；</tspan><tspan x="-10.5" y="396">桥是带着希望迎接美好明天的地方。</tspan><tspan style="font-family:MicrosoftYaHei-Bold, Microsoft YaHei;font-weight:700"><tspan x="31.5" y="432">桥，连接了中国生命命脉。</tspan></tspan></text><image width="2029" height="626" transform="translate(1589.11 1004.31) scale(0.06)" xlink:href="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB+0AAAJyCAYAAAF23mIlAAAACXBIWXMAAC4jAAAuIwF4pT92AAAgAElEQVR4nOy9TW4cOdOAmfnh3bt0AsvAALO0dAKXTtDyCbp0AssHGLi0nU3bi1m3dIKWT+DSCVpaDjCApRO4dIIcqF9Gf+FwBBn8y2RmxQMULFflD5NJMhg/DPbDMHSGYRwW/9PA067cvwP6YF7+v2W+u+/+99jL8YprGPNnqo7/0mE37u89+v6NcPya+e4t+vszuu6eOdYwDMTYHR9L82v0/5d/b7qu+47+D587d+xOmBFco3P6ruteMfcyjKXC9Ykg/xmhMl4K9bXrunP0XY+m53v3/w7NAjiuPb/BtQZ0LVoG7nvDmDtXXdd9im3jNSU+jEK90+OhYC//HrvpeY90/BzgWj26d4/KcEbKZBhLYZfyHLU6/kA69TH67eX7x0r3xffonJowoMqBmYYNAMZSOE55jtLuPNzh9256/vtI02zfVOdFhfiT/G7Tf2MJ4A6sbs8lO/5AptpRBSl8f98xHRqcTtyg4LMt1MIGHiMX3HlPnYtbRYmpPr3ZQPRtiSRrpMC1shP1SPd/mZF8c2qAz3BYk6GQjcMw1J2+KyDxoZOfoIAaTQcsPSNIuR4u60vn+zHBDAUwyW/EktV+ciT+BknPlE4v/T8W7QyDAsdfO2NjP6HkjxqtjYMH+sxNqtBIlfjQ2e5dVN15ZKe57brutwKSbl9oqvzyPM/E7VgbWvGxg6bNEg4TaAMPbqadRErHh46R2+lKd7AS17t3lTlF5z+Ujt+SUXMKI3QuKWV+mdG+Rv8/Sp3qg1EqpeOD31Fb8K37cPH6mBIv7+2E0/1DIinopDBJ/u+Jien0OOz9NfntR2zHx/r0ZeKCGCl4Z2A+W9dIoONzx5SkR3EHNa6fQ2nbyBRAmd81UJbv6O+p6nIbIWi0nV7VbmOm+vjGpaZrJaauNaa/Y1n5Y8pOX9TRBJ6IHNbOfQpMXe4UG0utctwEYkmkTvpMlrVjvpA1LJg+tuNznT5lEMAx9CWnfaV0NulZS5PT8fvE553KTtBKRwNaKg/Xp1L5wuSn+OWda1fn4VBcWkExHeTFcPa3W3dfI14/JXKQzmTo9cYwAKVeG6skoWvALAYzlaHtqIEytAauB9qOu8D39HcMO9BrdPzBddQ1+a4LdBruOn+PuEjno7JM3GAB3z26Z29NOknHSMcNTKcfE1ouahsaclxTC+A9qoeO/N2TNskh/S62G61xD8Jb4YVBRz9Dv8N3nKV/cKN8SgdKNbJ99pQJVyoe0N6Q3+9d569h/BnLldSyERCX7ZBDl2+Z7zSduVcK3Y5eK9TxcUguJxnBWIMHhB/MyNUrPABc4bkRMHQOBcqEraf4WXDHfyS/nxN9vzQ5nX4bKNNJw52eDubPE7v4zhTH1ObJXV96Z5tAH6CzaK8tx2fco9NgafTpSedeCdfw3adDVupTkkgTzt85NxAu0xkafDT3uXGdeRWqGE85p5j2x3RgaZDyfV8bX/mntKZPXQYKlOk9mgWE9HnpObzPpzHubRUVAzrKCq3FD3
